import React, {Fragment} from 'react'

function Message(props) {

  return (
    <Fragment>
      <span>{(props.time.m) >= 10 ? props.time.m : '0' + props.time.m}</span>&nbsp;:&nbsp;
    </Fragment>
  )

}

export default Message


